console.log(userInput);
```

However, if you are using TypeScript in a Node.js environment, you can use the `readline` module to get user input. Here is an example:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```

You can also use `prompt-sync` module which provides a synchronous interface for getting user input.

```typescript
import promptSync from 'prompt-sync';

const prompt = promptSync();

